// Escriba un script para devolver el valor que desea mostrar en el elemento emergente.
// Por ejemplo, obtener la media de 4 campos:
// Average($feature.SalesQ1, $feature.SalesQ2, $feature.SalesQ3, $feature.SalesQ4)

text($feature["codigo_local"])

// Escriba un script para devolver el valor que desea mostrar en el elemento emergente.
// Por ejemplo, obtener la media de 4 campos:
// Average($feature.SalesQ1, $feature.SalesQ2, $feature.SalesQ3, $feature.SalesQ4)

Proper($feature["direccion"], 'everyword')

var unidad = $feature["unidad_territorial"];

// Referencia a la otra capa o tabla
var tablaTelefonos = FeatureSetByName($map, "unidad_territorial");

// Busca el registro que coincide con el campo común
var resultado = Filter(tablaTelefonos, "unidad_territorial = @unidad");

// Extraer el número de teléfono si existe
var telefono = "";
if (Count(resultado) > 0) {
    var registro = First(resultado);
    telefono = registro["telefono"];
} else {
    telefono = "No disponible";
}

// Retornar el número de teléfono
return telefono;

